(ns year2020.day6.day6part2
  (:require [ysera.test :refer [is is= is-not]]
            [clojure.string :as str]
            [clojure.set :as set]))

(defn string->group
  {:test (fn []
           (is= (string->group "abc")
                (list #{\a \b \c}))
           (is= (string->group "ab\nc")
                (list #{\a \b} #{\c}))
           (is= (string->group "a\na\na")
                (list #{\a} #{\a} #{\a}))
           (is= (string->group "ab\ncccc")
                (list #{\a \b} #{\c})))}
  [string]
  (->> string
       (str/split-lines)
       (map (fn [line] (into #{} line)))))

(defn string->groups
  {:test (fn []
           (is= (string->groups "abc\n\na\nb\nc\n\nab\nac\n\na\na\na\na\n\nb")
                (list (list #{\a \b \c})
                      (list #{\a} #{\b} #{\c})
                      (list #{\a \b} #{\a \c})
                      (list #{\a} #{\a} #{\a} #{\a})
                      (list #{\b}))))}
  [string]
  (->> (str/split string #"\n\n")
       (map string->group)))

(defn day6part2
  {:test (fn []
           (is= (day6part2 "abc\n\na\nb\nc\n\nab\nac\n\na\na\na\na\n\nb")
                6))}
  [string]
  (->> string
       (string->groups)
       (map (fn [group] (reduce set/intersection group)))
       (map count)
       (reduce +)))









